<html lang="en">
<head>

  <title>Earthquake Rupture Track Viewer</title>
  <meta name="viewport" content="width=device-width, initial-scale=1">

  <script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"></script>
  <style>
    html, body { height: 100%; margin: 0; }
    #map { height: 100%; }

    .map-title {
    position: absolute;
    top: 10px;
    left: 50%;
    transform: translateX(-50%);
    background: rgba(255,255,255,0.9);
    padding: 8px 16px;
    font-size: 20px;
    font-weight: bold;
    border-radius: 5px;
    box-shadow: 0 0 6px rgba(0,0,0,0.2);
    z-index: 1000;
    font-family: sans-serif;
  }

    .leaflet-control-layers {
      font-size: 14px;
    }

    .legend {
      position: absolute;
      bottom: 10px;
      left: 10px;
      background: white;
      padding: 10px;
      border-radius: 5px;
      box-shadow: 0 0 6px rgba(0,0,0,0.3);
      font-size: 14px;
      z-index: 1000;
    }

    .legend-item {
      display: flex;
      align-items: center;
      margin-bottom: 4px;
    }

    .legend-line {
      width: 30px;
      height: 3px;
      margin-right: 6px;
    }

    .blue-solid {
      background-color: blue;
    }
    .red-dash {
      background: repeating-linear-gradient(
        to right,
        red,
        red 4px,
        white 4px,
        white 8px
      );
    }
    .black-dash {
      background: repeating-linear-gradient(
        to right,
        black,
        black 4px,
        white 4px,
        white 8px
      );
    }
  </style>
</head>

<div id="map"></div>

  // Earthquake Live Layer Placeholder
let quakeLayer;

  function loadEarthquakes() {
    const usgsURL = `https://earthquake.usgs.gov/earthquakes/feed/v1.0/summary/2.5_day.geojson`;

    fetch(usgsURL)
      .then(response => response.json())
      .then(data => {
        // Filter for Myanmar region
        const myanmarBounds = {
          minLat: 9.5,
          maxLat: 28.5,
          minLng: 92.0,
          maxLng: 101.5
        };

        const filtered = {
          ...data,
          features: data.features.filter(f => {
            const coords = f.geometry.coordinates;
            const lat = coords[1];
            const lng = coords[0];
            return (
              lat >= myanmarBounds.minLat && lat <= myanmarBounds.maxLat &&
              lng >= myanmarBounds.minLng && lng <= myanmarBounds.maxLng
            );
          })
        };

        if (quakeLayer) map.removeLayer(quakeLayer);

        quakeLayer = L.geoJSON(filtered, {
          pointToLayer: (feature, latlng) => {
            const mag = feature.properties.mag || 0;
            let color = mag >= 6 ? "#d73027" :
                        mag >= 5 ? "#fc8d59" :
                        mag >= 4 ? "#fee08b" :
                                   "#d9ef8b";
            return L.circleMarker(latlng, {
              radius: mag * 2.2,
              fillColor: color,
              color: "#333",
              weight: 1,
              opacity: 1,
              fillOpacity: 0.8
            });
          },
          onEachFeature: (feature, layer) => {
            const p = feature.properties;
            const time = new Date(p.time).toLocaleString();
            layer.bindPopup(
              `<strong>${p.place}</strong><br>
               <strong>Magnitude:</strong> ${p.mag}<br>
               <strong>Time:</strong> ${time}<br>
               <a href="${p.url}" target="_blank">View on USGS</a>`
            );
          }
        }).addTo(map);
      })
      .catch(err => console.error("USGS fetch error:", err));
  }

  // Initial load
  loadEarthquakes();

  // Update every 5 minutes
  setInterval(loadEarthquakes, 300000);


  // Add MSTC and USGS rupture layers by default
  //mstcLayer.addTo(map);
  //usgsLayer.addTo(map);
  faultLineLayer.addTo(map);


  // Layer control
  const baseLayers = {
    "Street Map (OSM)": osm,
    "ESRI Topo": esri,
    "Google Hybrid": googleHybrid
  };

const overlayLayers = {
  "MSTC Rupture": mstcLayer,
  "USGS Rupture": usgsLayer,
  "Fault Line": faultLineLayer,
 // "Live Earthquakes (USGS)": L.layerGroup() // placeholder, handled by fetch
};

  L.control.layers(baseLayers, overlayLayers, { collapsed: false }).addTo(map);
